// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./IPancakeRouter02.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IToken.sol";

contract IndexSwap {
    // TESTNET
    address internal constant pancakeSwapAddress =
        0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3; //Router for pancake bsc testnet

    /* 
    MAINNET
    address internal constant pancakeSwapAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    */

    IPancakeRouter02 public pancakeSwapRouter;
    IToken public nftToken;
    IToken public defiToken;
    using SafeMath for uint256;

    //  // Testnet address
    address private crypto1 = 0x7ef95a0FEE0Dd31b22626fA2e10Ee6A223F8a684; // usdt
    address private crypto2 = 0x78867BbEeF44f2326bF8DDd1941a4439382EF2A7; // busd
    address private crypto3 = 0x8a9424745056Eb399FD19a0EC26A14316684e274; // dai
    //   address private crypto4 = 0x8BaBbB98678facC7342735486C851ABD7A0d17Ca;
    //   address private crypto5 = 0xDAcbdeCc2992a63390d108e8507B98c7E2B5584a;

    // Mainnet Address
    // address private crypto1 = 0x2170Ed0880ac9A755fd29B2688956BD959F933F8; //ETH
    // address private crypto2 = 0x55d398326f99059fF775485246999027B3197955; //BUSD
    // address private crypto3 = 0x1D2F0da169ceB9fC7B3144628dB156f3F6c60dBE; // XRP
    //uint totalSum;

    struct rate {
        uint256 numerator;
        uint256 denominator;
    }
    mapping(address => uint256) admins;
    rate public currentRate;

    constructor(address _nftToken, address _defiToken) {
        pancakeSwapRouter = IPancakeRouter02(pancakeSwapAddress);
        nftToken = IToken(_nftToken);
        defiToken = IToken(_defiToken);
    }

    function updateRate(uint256 _numerator, uint256 _denominator) public {
        require(_numerator != 0);
        require(_denominator != 0);
        currentRate.numerator = _numerator;
        currentRate.denominator = _denominator;
    }

    function investInFundDeFi() public payable {
        // approve
        defiToken.approve(address(this), msg.value);

        // update rate
        updateRate(100, 100);

        uint256 deadline = block.timestamp + 15; // using 'now' for convenience, for mainnet pass deadline from frontend!

        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto1),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto2),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto3),
            msg.sender,
            deadline
        );

        uint256 tokenAmount = msg.value.mul(currentRate.numerator).div(
            currentRate.denominator
        );
        defiToken.mint(msg.sender, tokenAmount);
        // refund leftover ETH to user
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "refund failed");
    }

    function investInFundNFT() public payable {
        // approve
        nftToken.approve(address(this), msg.value);

        // update rate
        updateRate(100, 100);

        uint256 deadline = block.timestamp + 15; // using 'now' for convenience, for mainnet pass deadline from frontend!

        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto1),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto2),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value / 3,
            getPathForETH(crypto3),
            msg.sender,
            deadline
        );

        uint256 tokenAmount = msg.value.mul(currentRate.numerator).div(
            currentRate.denominator
        );
        nftToken.mint(msg.sender, tokenAmount);
        // refund leftover ETH to user
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "refund failed");
    }

    function withdrawFromFund(uint256 amount) public payable {
        uint256 deadline = block.timestamp + 15;
        nftToken.transferFrom(msg.sender, address(this), amount);
        nftToken.burn(address(this), amount);
    }

    function addLiquidity() public payable {
        uint256 deadline = block.timestamp + 15;
        nftToken.approve(pancakeSwapAddress, 1000000000000000000000000000);
        defiToken.approve(pancakeSwapAddress, 1000000000000000000000000000);
        // pancakeSwapRouter.addLiquidityEth{value: msg.value}();
    }

    function swapTest() public payable {
        pancakeSwapRouter.swapETHForExactTokens{value: msg.value / 3}(
            msg.value,
            getPathForETH(crypto1),
            msg.sender,
            block.timestamp + 30
        );
    }

    function getPathForETH(address crypto)
        public
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
        path[0] = pancakeSwapRouter.WETH();
        path[1] = crypto;
        return path;
    }

    function getPathForToken(address token)
        public
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
        path[0] = token;
        path[1] = pancakeSwapRouter.WETH();
        return path;
    }

    function getETH() public view returns (address) {
        return pancakeSwapRouter.WETH();
    }

    // important to receive ETH
    receive() external payable {}
}
